import React from 'react';
import { Input, Button } from 'semantic-ui-react';
import { Input as AntInput, Button as AntButton } from 'antd';

export default function Home({ handleChange, handleSearch, cityName }) {
  return (
    <div>
      <h1>Travel Bug</h1>
      {/* Semantic UI Input */}
      <Input
        fluid
        label="City Name"
        placeholder="Enter city name..."
        value={cityName}
        name="cityName"
        onChange={handleChange}
      />
      {/* Ant Design Input */}
      <AntInput
        placeholder="Enter city name..."
        value={cityName}
        name="cityName"
        onChange={handleChange}
      />
      <div style={{ marginTop: '10px' }}>
        {/* Semantic UI Button */}
        <Button primary onClick={handleSearch}>
          Search
        </Button>
        {/* Ant Design Button */}
        <AntButton type="primary" onClick={handleSearch}>
          Search
        </AntButton>
      </div>
      <p>Elevator Pitch</p>
    </div>
  );
}
